import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <footer className="footerContainer">
      <p>Thank you for visiting my personal portfolio website. Reach out to me over social media.</p>
      <p><i className="fas fa-envelope"></i> navdeepkaur61@loyalistcollege.com</p>
      <p><i className="fas fa-map-marked-alt"></i> Punjab, India-141016</p>
      <div className="socialLinks">
        <a href="mailto:navdeepkaur61@loyalistcollege.com" target="_blank" rel="noopener noreferrer" className="fas fa-envelope"></a>
        <a href="https://www.linkedin.com/in/navdeep-kaur-18474b2aa/" target="_blank" rel="noopener noreferrer" className="fab fa-linkedin"></a>
        <a href="https://github.com/Navdeepkaur61" target="_blank" rel="noopener noreferrer" className="fab fa-github"></a>
      </div>
      <h1 className="credit">Designed By <a>Navdeep Kaur</a></h1>
    </footer>
  );
};

export default Footer;
